func transmitSessionID(id SessionID) {
	m := getPproLabel()

	var n labelMap
	if m == nil {
		n = make(labelMap)
	} else {
		n = make(labelMap, len(*m))
		for k, v := range *m {
			if k != Pprof_Label_Session_ID {
				n[k] = v
			}
		}
	}

	n[Pprof_Label_Session_ID] = strconv.FormatInt(int64(id), 10)
	setPprofLabel(&n)
}

